import React from 'react';
import { View, StatusBar, FlatList, Text } from 'react-native';
import { Context } from '../../Provider';

import { colors } from '../../styles';

// Components
import EmptyLikes from './EmptyLikes';

function LikeContainer() {
	return (
		<Context.Consumer>
			{(val) => {
				return (
					<View style={{ justifyContent: 'center', alignItems: 'center', backgroundColor: 'white', flex: 1 }}>
						<StatusBar backgroundColor={colors.mainColor} />

						{val.liked.length ? (
							<FlatList
								numColumns={2}
								data={val.liked}
								renderItem={({ item }) => (
									<View>
										<Text>rendered</Text>
									</View>
								)}
							/>
						) : (
							<EmptyLikes />
						)}

						<Button onPress={() => val.like({ name: 'yo', key: '1' })} title="Add to liked" />
					</View>
				);
			}}
		</Context.Consumer>
	);
}

export default LikeContainer;
